import React from 'react'
import { Button } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import "./sidebar.css";
import SidebarOptions from './SidebarOptions';
import InboxIcon from '@mui/icons-material/Inbox';
import StarRateIcon from '@mui/icons-material/StarRate';
import WatchLaterIcon from '@mui/icons-material/WatchLater';
import LabelImportantIcon from '@mui/icons-material/LabelImportant';
import SendIcon from '@mui/icons-material/Send';
import DraftsIcon from '@mui/icons-material/Drafts';
import LabelIcon from '@mui/icons-material/Label';
import DeleteIcon from '@mui/icons-material/Delete';

function SideBar() {
  return (
    <div className='sidebar'>
      <Button startIcon={<AddIcon />} className='compose__btn'>Compose</Button>

      <SidebarOptions Icon={InboxIcon} title={"Inbox"} number={234} />
      <SidebarOptions Icon={StarRateIcon} title={"Starred"} number={234} />
      <SidebarOptions Icon={WatchLaterIcon} title={"Snoozed"} number={234} />
      <SidebarOptions Icon={LabelImportantIcon} title={"Important"} number={234} />
      <SidebarOptions Icon={SendIcon} title={"sent"} number={234} />
      <SidebarOptions Icon={DraftsIcon} title={"Draft"} number={234} />
      <SidebarOptions Icon={LabelIcon} title={"Category"} number={234} />
      <SidebarOptions Icon={DeleteIcon} title={"Trash"} number={234} />
      <SidebarOptions Icon={DeleteIcon} title={"d"} number={234} />
      <SidebarOptions Icon={DeleteIcon} title={"d"} number={234} />
    </div>
  )
}

export default SideBar;
